const AboutContext = React.createContext({
    name: "",
    setName: () => {}
});

const AboutContextProvider = ({ children}) => {
    const [name, setName] = useState(value);

    return (
        <AboutContext.Provider value={{name, setName}}>
            {children}
            {console.log("provider: ", name)}
        </AboutContext.Provider>
    )
}
